import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // CSSファイルのインポート
import 'src/theme/svg'

export const Header = () => {
    return(
        <div className='header-wrapper'>
            <Link to='/'><img src='/theme/svg/F.svg'/></Link>
            <Link to='/theme'>テーマ</Link>
        </div>
    )
}
